window.bookSummaryJSON = "<p><b>I want to live my life in peace for a little while as opposed to pieces. I don’t know who I have to bribe to catch a break, but I’m willing to pay the big bucks.</b></p> <p>Apparently, no one got the memo. Midlife is one messy ride.</p> <p>Fine. I’m off to Lexington, Kentucky to find a self-proclaimed dragon who sports a mullet, beer belly and delusions of Immortal grandeur. This time he’s gone too far. He’s messed with me and mine for the last time.</p> <p>The way to end a dragon is to remove his tail. We thought we had. A tail is in the back. Right?</p> <p>Wrong.</p> <p>So, so wrong.</p> <p>With the love of my Immortal life by my side along with a few smack-talking, geriatric Nephilim and a foul-mouthed, toothpick loving Keeper of Fate, I’m ready.</p> <p>And when it’s done, I’m taking a freaking vacation. I’ve earned it.</p> <p>It’s time to slay the dragon for good.</p> <p>This time there will be no mercy.</p>"; 
